import React from "react";
// index에서 render를 이용해 하나의 function만 가능하므로 정의한 함수에 파편적으로 넣을 것
function Food() {
  return (
    <h1>I like Food</h1>
  )
}


function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Food fav="kimchi" something={true} other={['sejin', 'raven']} />
    </div >
  );
}
// component 정의시 대문자로

export default App;
